DataUtil=function(){function e(){}e.setCookie=function(e,t,n){if(n==undefined)n=30;var r=new Date;r.setDate(r.getDate()+n);var i=escape(t)+(n==null?"":"; expires="+r.toUTCString());document.cookie=e+"="+i};e.getCookie=function(e){var t=document.cookie.match("(^|;) ?"+e+"=([^;]*)(;|$)");if(t)return unescape(t[2]);else return null};e.deleteCookie=function(e){var t=new Date;t.setTime(t.getTime()-1);document.cookie=e+="=; expires="+t.toGMTString()};return e}()
